)This simple experiment was conducted to investigate the light interception and subsequent growth of wheat under different populations invoked using row spacing. Wheat was sown at Gatton on 15th of June 2011 at 25cm row spacing. Soon after emergence, alternate rows were removed from selected plots to produce half populations at 50cm row spacing. A zero N treatment was used to identfy the inherent fertility of the site to assist in model parameterisation. Data were collected on light interception, canopy development, biomass accumulation and yield.

